import React from 'react';
import { useNavigate } from 'react-router-dom';


const NotFound = () => {
  const navigate= useNavigate();

  const redirectToLogin = () => {
    navigate('/sign-in');
  };

  return (
    <div className='booking_area w-full' >
      <div className="max-w-6xl w-full px-4 lg:px-0 mx-auto">
        <div className="pt-40 pb-20">
          <div className="max-w-lg w-full bg-white drop-shadow mx-auto rounded-md py-20 px-4 text-center">
            <h2 className='font-extrabold text-3xl'>Login Needed</h2>
            <p className="text-gray-600 mt-2">You need to log in to access this page.</p>
            <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded mt-4" onClick={redirectToLogin}>
              Redirect to Login
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default NotFound;
